import React, { useState } from 'react';
import { useNavigate, Link } from 'react-router-dom';
import { useAuth } from '../context/AuthContext';
import { Container, Form, Button, Card, Alert, Row, Col } from 'react-bootstrap';

const Register = () => {
  const [formData, setFormData] = useState({
    username: '',
    email: '',
    password: '',
    firstName: '',
    lastName: '',
    role: 'member',
  });
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  const { register } = useAuth();
  const navigate = useNavigate();

  const handleChange = (e) => {
    setFormData((prev) => ({
      ...prev,
      [e.target.name]: e.target.value,
    }));
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true);
    setError('');
    setSuccess('');

    const userData = {
      ...formData,
      role: [formData.role],
    };

    const result = await register(userData);

    if (result.success) {
      setSuccess(result.message);
      setTimeout(() => {
        navigate('/login');
      }, 2000);
    } else {
      setError(result.message);
    }

    setLoading(false);
  };

  return (
    <section
      className="section bg-light"
      aria-label="register"
      style={{ paddingTop: '100px', paddingBottom: '80px', minHeight: '80vh' }}
    >
      <Container>
        <Row className="justify-content-center">
          <Col xs={12} md={8} lg={6}>
            <Card className="shadow-sm border-0 rounded-3">
              <Card.Header className="bg-white border-0 pb-0">
                <h3 className="text-center mt-4 mb-3" style={{ fontFamily: "'Catamaran', sans-serif", color: 'var(--rich-black-fogra-29-1)' }}>
                  Register for Gym Management
                </h3>
              </Card.Header>
              <Card.Body>
                {error && (
                  <Alert variant="danger" className="text-center">
                    {error}
                  </Alert>
                )}
                {success && (
                  <Alert variant="success" className="text-center">
                    {success}
                  </Alert>
                )}

                <Form onSubmit={handleSubmit} noValidate>
                  <Row>
                    <Col md={6}>
                      <Form.Group controlId="firstName" className="mb-3">
                        <Form.Label>First Name</Form.Label>
                        <Form.Control
                          type="text"
                          name="firstName"
                          value={formData.firstName}
                          onChange={handleChange}
                          placeholder="Enter first name"
                          required
                          className="input-field"
                        />
                      </Form.Group>
                    </Col>

                    <Col md={6}>
                      <Form.Group controlId="lastName" className="mb-3">
                        <Form.Label>Last Name</Form.Label>
                        <Form.Control
                          type="text"
                          name="lastName"
                          value={formData.lastName}
                          onChange={handleChange}
                          placeholder="Enter last name"
                          required
                          className="input-field"
                        />
                      </Form.Group>
                    </Col>
                  </Row>

                  <Form.Group controlId="username" className="mb-3">
                    <Form.Label>Username</Form.Label>
                    <Form.Control
                      type="text"
                      name="username"
                      value={formData.username}
                      onChange={handleChange}
                      placeholder="Enter username"
                      required
                      className="input-field"
                    />
                  </Form.Group>

                  <Form.Group controlId="email" className="mb-3">
                    <Form.Label>Email</Form.Label>
                    <Form.Control
                      type="email"
                      name="email"
                      value={formData.email}
                      onChange={handleChange}
                      placeholder="Enter email"
                      required
                      className="input-field"
                    />
                  </Form.Group>

                  <Form.Group controlId="password" className="mb-4">
                    <Form.Label>Password</Form.Label>
                    <Form.Control
                      type="password"
                      name="password"
                      value={formData.password}
                      onChange={handleChange}
                      placeholder="Enter password"
                      required
                      className="input-field"
                    />
                  </Form.Group>

                  <Form.Group controlId="role" className="mb-4">
                    <Form.Label>Role</Form.Label>
                    <Form.Select name="role" value={formData.role} onChange={handleChange} aria-label="Select role">
                      <option value="member">Member</option>
                      {/* Extend roles here when needed */}
                    </Form.Select>
                  </Form.Group>

                  <Button
                    variant="danger"
                    type="submit"
                    className="w-100 py-3 text-uppercase fw-semibold"
                    disabled={loading}
                    style={{ fontSize: '1.1rem' }}
                  >
                    {loading ? 'Registering...' : 'Register'}
                  </Button>
                </Form>

                <div className="text-center mt-4" style={{ fontFamily: "'Rubik', sans-serif" }}>
                  <p>
                    Already have an account?{' '}
                    <Link to="/login" className="text-danger" style={{ fontWeight: '600', textDecoration: 'none' }}>
                      Login here
                    </Link>
                  </p>
                </div>
              </Card.Body>
            </Card>
          </Col>
        </Row>
      </Container>
    </section>
  );
};

export default Register;
